const JsSIP = require('jssip')

const register = (user, pass, cb) => {
    console.log('Registering to SIP')
    JsSIP.debug.disable('JsSIP:*')
    let socket = new JsSIP.WebSocketInterface('wss://webrtc.1com.co.il/ws')

    const configuration = {
        sockets: [socket],
        uri: 'sip:' + user + '@webrtc.1com.co.il',
        authorization_user: user,
        password: pass,
        connection_recovery_min_interval: 3,
        register: true
    }
    let ua = new JsSIP.UA(configuration)
    ua.start()
    cb(ua)
}

export {
    register
}
